import React from 'react';
import '../../css/Teams.css';
import TeamPreview from './TeamPreview.js';

const TeamList = (props) => {

    const showTeams = () => {
        let teams = [];
        for (let i = 0; i < props.data.length; i++) {
            teams.push(
                <TeamPreview name={props.data[i].name}/>
            )
        }

        return teams;
    }
    return (
        <div>
            {showTeams()}
        </div>
    )
}

export default TeamList;
